column8:
　☆ハイポジション<br>足元から腰までしっかり暖まる<br><br>温風が足元から腰までをしっかりカバーします。<br><br>冬の脱衣所のヒートショック対策のほか、立ち作業の多いキッチンやリビングなどのスポット暖房にもおすすめです。<br><br>☆すぐにぽかぽか<br>電源を入れたらすぐに温風<br><br>電源を入れたら、すぐに温風が吹き出します。<br>セラミックヒーターなので、空気も汚しません。<br><br>「 高温（ 1200 W ）/ 低温（ 800 W ）」の設定が可能。<br><br>首振り機能<br>約 80 °の範囲で左右に首振りをさせることもできます。<br><br>送風モード<br>送風のみの設定もできます。<br>お部屋の空気の入れ替えや、部屋干し等にも便利です。<br><br>☆もしもの時も安心・安全<br>ちょっと触れてしまっても大丈夫<br><br>温風の吹出口には起毛処理を施してあるので、ちょっと手が触れた程度ならやけどの心配はありません。<br><br>※ 使用中や使用直後の吹出口部は高温になっています。<br>　 やけどにの原因にもなりますので長時間触り続けないでください。<br><br> 3つの安全装置<br>オフタイマー<br>運転開始から 約 3 時間で自動的に電源が切れるので、スイッチの消し忘れ防止に役立ちます。<br>運転開始時 自動で 3 時間設定されますが、2 時間、1 時間に手動設定することもできます。<br><br>転倒OFFスイッチ<br>製品が倒れたら自動的に通電を止めるので、事故防止に役立ちます。<br><br>※ 本体を振るとカラカラと音がしますが、これは転倒OFFスイッチ（ 安全装置 ）の音です。<br>　 異常ではありません。<br><br>異常温度感知機能<br>フィルターがつまったり、吹出口や吸込口がふさがれて内部温度が高くなった場合、温度過昇防止装置が働き 運転を停止します。<br><br>☆楽々操作 楽々メンテ<br>楽々操作<br><br>操作部が本体天面にあるので、かがまずに操作できます。<br>表示も LED表示により運転状態がわかりやすくなっています。<br><br>メモリー機能<br>運転停止後に再び「入 / 切 」スイッチで運転を開始すると、停止する前の状態で運転が始まります。<br>（ オフタイマー残り時間はメモリーされず、改めて 3 時間の設定に戻ります。 ）<br><br>※ 停電や主電源スイッチを「 切 」の状態にしたり 電源プラグを抜くと、メモリー機能はリセット（ 解除 ）されます。<br><br>【仕様】<br>製品寸法 約 270 ×270 ×885 mm<br>製品質量 約 3.7 kg<br>定格電圧 AC 100 V　50 / 60 Hz<br>消費電力 高：1200 W　低：800 W　送風：30 W<br>待機時：0.2 W（ 主電源スイッチで完全に切ることもできます ）<br>オフタイマー 3 時間（ 電源 ON 時に自動設定 ）<br>※ 2 時間、1 時間に手動設定することもできます<br>電源コード有効長 約 1.7 m<br>ヒーター セラミックヒーター<br>転倒オフスイッチ 内蔵式<br>温度切替 高 / 低<br>表示 LED にて動作状態を表示<br>　温度（ 高・低 ）<br>　モード（ 温風・送風 ）<br>　スイング表示（ 点灯・非点灯 ）<br>　タイマー時間表示（ 3 時間・2 時間・1 時間 ）<br>首振り機能 約 80 °<br>天面操作スイッチ 電源（ 入 / 切 ）<br>温度切替（ 高・低 ）<br>モード（ 温風・送風 ）<br>スイング（ 入・切 ）<br>タイマー（ 電源ONで 3 時間に自動設定 / 手動で 2 時間・1 時間設定可能 ）<br>主電源 シーソースイッチ（ 本体下部 ）<br><br>?寸法は 幅 × 奥行 × 高さ の順で記載しております。<br>?商品改良のため、デザイン、仕様を一部予告なく変更することがありますので、ご了承ください。<br>?商品写真は実際の色とは若干異なる場合があります。<br>?商品には安全にお使いいただくため、注意表示をしているものがあります。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ツインバード<br>製品寸法：約 270 ×270 ×885 mm<br>製品質量：約 3.7 kg<br>カラー：ホワイト<br><br>購入単位：1台<br><table width=610 border=0 cellspacing=0><tr><td bgcolor=#ffffff><p style=margin:10px;>配送種別：<b>別送品　<font color=#ff0000>代引不可　返品不可　配送日時指定不可</font></b><br><font size=2>　※商品はメーカーより直送させて頂くため、代金引換でのご注文はお受け致しかねます。<br>　※こちらの商品は他の商品とは別のお届けとなります。<br>　※メーカー直送のため、納品・請求書は商品とは別に郵送させていただきます。<br>　※商品はメーカーより直送させて頂くため、ご希望配送日時の指定はできません。<br>　※メーカーにて欠品発生時はこちらからご連絡させて頂くこともございます。</font><br><br>※北海道・沖縄・離島は送料別途見積りとなります。</p></td></tr></table></p></td></tr></table><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/pix_daibi.gif><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/pix_henpin.gif><br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>楽天 通販 電化製品 空調 冷暖房機器 暖房器具 その他暖房器具 すりむたわーふぁんひーたー FH-D191W  P54046 9N0828 ついんばーど ツインバード タワーファン たわーふぁん ファン ふぁん 温度センサー付きタワーファン 温度センサー 暖房 扇風機 サーキュレーター せんぷうき だんぼう 冷房 れいぼう エコ</font></td></tr></table></font><style type="text/css">
